import { useHistory } from 'react-router-dom';

function Home () {
    const history = useHistory();
    return(
        <>
        <button onClick={history.push('/find')}>Works Pretty Good</button>
        <button onClick={history.push('/soup')}>Very Broken But Fun</button>
        </>
    )
}

export default Home;
